import axios from 'axios';
import styled from 'styled-components';
import BaseEvent from '../../components/event/Event'
import { NextPage } from 'next';
import { useEffect } from 'react';
import { Event } from './event.types'

const EventWrapper = styled.div`
`

const EventPage: NextPage<Event> = ({id, time, title, creator, guests, drinkType, location, comments }: Event) => {
  useEffect(() => {

  }, [])
  return (
    <EventWrapper>
      <BaseEvent
        id={id}
        time={time}
        title={title}
        creator={creator}
        guests={guests}
        drinkType={drinkType}
        location={location}
        comments={comments}
      />
    </EventWrapper>
  )
}

EventPage.getInitialProps = async (context) => {
  const { id } = context.query;
  console.log('getting stuff')
  const res = await axios.get<Event>(`https://mock-api.drinks.test.siliconrhino.io/events/${id}`);
  const event = await res.data
  console.log(`Fetched data: `, res);

  return { event };
};

export default EventPage;
